const DiaryItem = ({item})=>{
    return(
        <div className="DiaryItem">
            <div key={item.id}>
                <div>작성자: {item.author}</div>
                <div>내용 : {item.content}</div>
                <div>감정: {item.emotion}</div>
                <div>작성시간: {item.created_date}</div>
            </div>
        </div>
    )
}

export default DiaryItem;
